import React from 'react';

function PairingDashboard({ dashboard }) {
  return (
    <div className="pairing-dashboard">
      <h2>Pairing Dashboard</h2>
      <div className="pair-list">
        <h3>Current Pairs</h3>
        <ul>
          {dashboard.map((p, index) => (
            <li key={index}>{`${p[0]} & ${p[1]}`}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default PairingDashboard;
